"use strict";

function letterCasePermutation(s) {
    function dfs(i, t) {
        if (i === t.length) {
            ans.push(t.join(''));
            return;
        }
        dfs(i + 1, t);
        if (t[i].match(/[a-zA-Z]/)) {
            t[i] = t[i].toUpperCase() === t[i] ? t[i].toLowerCase() : t[i].toUpperCase();
            dfs(i + 1, t);
        }
    }
    let ans = [];
    let t = s.split('');
    dfs(0, t);
    return ans;
}
